import React, {Component} from 'react';

class Blog extends Component {
    
    constructor(props) {
        super(props);
        this.state = {
          id: null
        };
    }

    componentDidMount() {
        console.log(this.state.id);
        let id = this.props.children.match.params.blog_id;
        this.setState({
            id: id
        })
    }
    
    render() {
        return (
            <div className="blogs">
                <h4>{this.state.id}</h4>
            </div>
        )
    }
}

export default Blog;
